message:
Updated GoraDeleteStorage to allow STORE that deletes rows by key.
Bugfixes in GoraStorage when storing.

Delete syntaxis, given a (key:chararray) relation:

STORE tuples_to_delete INTO '.' USING org.apache.gora.pig.GoraDeleteStorage('{
        "persistentClass": "admin.WebPage",
        "goraProperties": "gora.datastore.default=org.apache.gora.hbase.store.HBaseStore",
        "mapping": "<?xml version=\\"1.0\\" encoding=\\"UTF-8\\"?><gora-odm><table name=\\"webpage_dest\\"><family name=\\"f\\" maxVersions=\\"1\\"/></table><class table=\\"webpage_dest\\" keyClass=\\"java.lang.String\\" name=\\"admin.WebPage\\"></class></gora-odm>",
        "configuration": {
            "hbase.zookeeper.quorum": "hdp4,hdp1,hdp3",
            "zookeeper.znode.parent": "/hbase-unsecure"
        }
}') ;

Updated Pig's GoraStorage to allow STORE operations.

It performs a map-side store with this script:

**
set job.name 'GoraPig test3';
register gora/*.jar;
webpage = LOAD '.' USING org.apache.gora.pig.GoraStorage('{
        "persistentClass": "admin.WebPage",
        "fields": "baseUrl",
        "goraProperties": "gora.datastore.default=org.apache.gora.hbase.store.HBaseStore\\ngora.datastore.autocreateschema=true\\ngora.hbasestore.scanner.caching=4",
        "mapping": "<?xml version=\\"1.0\\" encoding=\\"UTF-8\\"?>\\n<gora-odm>\\n  <table name=\\"webpage\\">\\n    <family name=\\"f\\" maxVersions=\\"1\\"/>\\n  </table>\\n  <class table=\\"webpage\\" keyClass=\\"java.lang.String\\" name=\\"admin.WebPage\\">\\n    <field name=\\"baseUrl\\" family=\\"f\\" qualifier=\\"bas\\"/>\\n  </class>\\n</gora-odm>",
        "configuration": {
            "hbase.zookeeper.quorum": "hdp4,hdp1,hdp3",
            "zookeeper.znode.parent": "/hbase-unsecure"
        }
}') ;

webpage_dest = STORE webpage INTO '.' USING org.apache.gora.pig.GoraStorage('{
        "persistentClass": "admin.WebPage",
        "fields": "baseUrl",
        "goraProperties": "gora.datastore.default=org.apache.gora.hbase.store.HBaseStore\\ngora.datastore.autocreateschema=true\\ngora.hbasestore.scanner.caching=4",
        "mapping": "<?xml version=\\"1.0\\" encoding=\\"UTF-8\\"?>\\n<gora-odm>\\n  <table name=\\"webpage_dest\\">\\n    <family name=\\"f\\" maxVersions=\\"1\\"/>\\n  </table>\\n  <class table=\\"webpage_dest\\" keyClass=\\"java.lang.String\\" name=\\"admin.WebPage\\">\\n    <field name=\\"baseUrl\\" family=\\"f\\" qualifier=\\"bas\\"/>\\n <field name=\\"contentType\\" family=\\"f\\" qualifier=\\"typ\\"/>\\n</class>\\n</gora-odm>",
        "configuration": {
            "hbase.zookeeper.quorum": "hdp4,hdp1,hdp3",
            "zookeeper.znode.parent": "/hbase-unsecure"
        }
}') ;
**

and a reduce-side store with this other:

**

set job.name 'GoraPig test4';
register gora/*.jar;
webpage = LOAD '.' USING org.apache.gora.pig.GoraStorage('{
        "persistentClass": "admin.WebPage",
        "fields": "baseUrl",
        "goraProperties": "gora.datastore.default=org.apache.gora.hbase.store.HBaseStore\\ngora.datastore.autocreateschema=true\\ngora.hbasestore.scanner.caching=4",
        "mapping": "<?xml version=\\"1.0\\" encoding=\\"UTF-8\\"?>\\n<gora-odm>\\n  <table name=\\"webpage\\">\\n    <family name=\\"f\\" maxVersions=\\"1\\"/>\\n  </table>\\n  <class table=\\"webpage\\" keyClass=\\"java.lang.String\\" name=\\"admin.WebPage\\">\\n    <field name=\\"baseUrl\\" family=\\"f\\" qualifier=\\"bas\\"/>\\n  </class>\\n</gora-odm>",
        "configuration": {
            "hbase.zookeeper.quorum": "hdp4,hdp1,hdp3",
            "zookeeper.znode.parent": "/hbase-unsecure"
        }
}') ;

webpage2 = LOAD '.' USING org.apache.gora.pig.GoraStorage('{
        "persistentClass": "admin.WebPage",
        "fields": "contentType",
        "goraProperties": "gora.datastore.default=org.apache.gora.hbase.store.HBaseStore\\ngora.datastore.autocreateschema=true\\ngora.hbasestore.scanner.caching=4",
        "mapping": "<?xml version=\\"1.0\\" encoding=\\"UTF-8\\"?>\\n<gora-odm>\\n  <table name=\\"webpage\\">\\n    <family name=\\"f\\" maxVersions=\\"1\\"/>\\n  </table>\\n  <class table=\\"webpage\\" keyClass=\\"java.lang.String\\" name=\\"admin.WebPage\\">\\n    <field name=\\"contentType\\" family=\\"f\\" qualifier=\\"typ\\"/>\\n </class>\\n</gora-odm>",
        "configuration": {
            "hbase.zookeeper.quorum": "hdp4,hdp1,hdp3",
            "zookeeper.znode.parent": "/hbase-unsecure"
        }
}') ;

joined = JOIN webpage BY key, webpage2 BY key;
joined2 = FOREACH joined GENERATE webpage::key as key, webpage::baseUrl as baseUrl, webpage2::contentType as contentType;

webpage_dest = STORE joined2 INTO '.' USING org.apache.gora.pig.GoraStorage('{
        "persistentClass": "admin.WebPage",
        "fields": "baseUrl,contentType",
        "goraProperties": "gora.datastore.default=org.apache.gora.hbase.store.HBaseStore\\ngora.datastore.autocreateschema=true\\ngora.hbasestore.scanner.caching=4",
        "mapping": "<?xml version=\\"1.0\\" encoding=\\"UTF-8\\"?>\\n<gora-odm>\\n  <table name=\\"webpage_dest\\">\\n    <family name=\\"f\\" maxVersions=\\"1\\"/>\\n  </table>\\n  <class table=\\"webpage_dest\\" keyClass=\\"java.lang.String\\" name=\\"admin.WebPage\\">\\n    <field name=\\"baseUrl\\" family=\\"f\\" qualifier=\\"bas\\"/>\\n <field name=\\"contentType\\" family=\\"f\\" qualifier=\\"typ\\"/>\\n</class>\\n</gora-odm>",
        "configuration": {
            "hbase.zookeeper.quorum": "hdp4,hdp1,hdp3",
            "zookeeper.znode.parent": "/hbase-unsecure"
        }
}') ;

**

Updated GoraStorage to allow several LOADs from different origins.
Now the following script is supported:

set job.name 'GoraPig test';
register gora/*.jar;
webpage = LOAD '.' USING org.apache.gora.pig.GoraStorage('{
        "persistentClass": "admin.WebPage",
        "fields": "baseUrl",
        "goraProperties": "gora.datastore.default=org.apache.gora.hbase.store.HBaseStore\\ngora.datastore.autocreateschema=true\\ngora.hbasestore.scanner.caching=4",
        "mapping": "<?xml version=\\"1.0\\" encoding=\\"UTF-8\\"?>\\n<gora-odm>\\n  <table name=\\"webpage\\">\\n    <family name=\\"f\\" maxVersions=\\"1\\"/>\\n  </table>\\n  <class table=\\"webpage\\" keyClass=\\"java.lang.String\\" name=\\"admin.WebPage\\">\\n    <field name=\\"baseUrl\\" family=\\"f\\" qualifier=\\"bas\\"/>\\n  </class>\\n</gora-odm>",
        "configuration": {
            "hbase.zookeeper.quorum": "hdp4,hdp1,hdp3",
            "zookeeper.znode.parent": "/hbase-unsecure"
        }
}') ;

webpage2 = LOAD '.' USING org.apache.gora.pig.GoraStorage('{
        "persistentClass": "admin.WebPage",
        "fields": "contentType",
        "goraProperties": "gora.datastore.default=org.apache.gora.hbase.store.HBaseStore\\ngora.datastore.autocreateschema=true\\ngora.hbasestore.scanner.caching=4",
        "mapping": "<?xml version=\\"1.0\\" encoding=\\"UTF-8\\"?>\\n<gora-odm>\\n  <table name=\\"webpage\\">\\n    <family name=\\"f\\" maxVersions=\\"1\\"/>\\n  </table>\\n  <class table=\\"webpage\\" keyClass=\\"java.lang.String\\" name=\\"admin.WebPage\\">\\n    <field name=\\"contentType\\" family=\\"f\\" qualifier=\\"typ\\"/>\\n <field name=\\"baseUrl\\" family=\\"f\\"/>\\n  </class>\\n</gora-odm>",
        "configuration": {
            "hbase.zookeeper.quorum": "hdp4,hdp1,hdp3",
            "zookeeper.znode.parent": "/hbase-unsecure"
        }
}') ;

joined = JOIN webpage BY key, webpage2 BY key;
joined2 = FOREACH joined GENERATE webpage::key, webpage::baseUrl, webpage2::contentType;
dump joined2 ;

Support in gora-pig of JSON configuration for GoraStorage.

The format is the following:

set job.name 'GoraPig test';
register gora/*.jar;
webpage = LOAD '.' USING org.apache.gora.pig.GoraStorage('{
        "persistentClass": "admin.WebPage",
        "fields": "baseUrl,status",
        "goraProperties": "gora.datastore.default=org.apache.gora.hbase.store.HBaseStore\\ngora.datastore.autocreateschema=true\\ngora.hbasestore.scanner.caching=4",
        "mapping": "<?xml version=\\"1.0\\" encoding=\\"UTF-8\\"?>\\n<gora-odm>\\n  <table name=\\"webpage\\">\\n    <family name=\\"f\\" maxVersions=\\"1\\"/>\\n  </table>\\n  <class table=\\"webpage\\" keyClass=\\"java.lang.String\\" name=\\"admin.WebPage\\">\\n    <field name=\\"baseUrl\\" family=\\"f\\" qualifier=\\"bas\\"/>\\n    <field name=\\"status\\" family=\\"f\\" qualifier=\\"st\\"/>\\n  </class>\\n</gora-odm>",
        "configuration": {
            "hbase.zookeeper.quorum": "hdp4,hdp1,hdp3",
            "zookeeper.znode.parent": "/hbase-unsecure"
        }
}') ;
dump webpage ;
